export default function MenuContainerButton(props) {
    return (
        //<button className="card-btn" onClick={props.link}>
        //<button className="card-btn" onClick={props.onButtonClick}>
        <button className="card-btn" onClick={
            () => {
                props.link();
                props.onButtonClick();
                console.log(props.id)
            }
        }>
            <span className="card-btn-title">
                <i className={props.icon}></i>
            </span>
            <span className="card-btn-desc">{props.linkText}</span>
        </button>
    )
}
